import './Landing.css';

import { Link } from "react-router-dom"

const Landing = () => {
    return (

        <div className='landinContent' >
            <p className='imgTitle' />

            <div className="data">
                <h1 className='titulo fondi'>Todos los pokemones </h1>

                <h3 className='fondi'>Acá podrás ver toda la información acerca del pokemon que gustes! </h3>
            </div>

            <Link className='home' to="home"> Comenzar </Link>
        </div>

    )
}

export default Landing;
